import React from "react";
import { FaArrowLeft } from "react-icons/fa";
import "./life_at_manet.css";

const LifeAtManet = () => {
  const cardsData = [
    {
      buttons: [
        { text: "Explore Team", link: "#" },
        { text: "Our Culture", link: "#" },
        { text: "Events", link: "#" },
      ],
    },
    {
      buttons: [
        { text: "Workshops", link: "#" },
        { text: "Achievements", link: "#" },
        { text: "Projects", link: "#" },
      ],
    },
    {
      buttons: [
        { text: "Innovation", link: "#" },
        { text: "Training", link: "#" },
        { text: "Community", link: "#" },
      ],
    },
  ];

  return (
    <section className="lifeatmanet-section">
      <div className="overlay">
        <h2 className="lifeatmanet-title">Life at MaNet</h2>
        <p className="lifeatmanet-subtitle">Experience the vibe of our workplace</p>

        <div className="cards-container">
          {cardsData.map((card, index) => (
            <div key={index} className="life-card">
              {card.buttons.map((btn, i) => (
                <a key={i} href={btn.link} className="card-btn">
                  <FaArrowLeft className="btn-icon" />
                  <span className="btn-text">{btn.text}</span>
                </a>
              ))}
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default LifeAtManet;
